import React, {useState, useEffect} from 'react';
import axios from 'axios';
import {Jumbotron, Button} from 'react-bootstrap/Jumbotron';


import Companies from './Companies';
import Car from './Car';
import { Fragment } from 'react';

export default function Customers(){

  const [companyList, setCompanyList] = useState([]);
  const [loading, setloading] = useState(true);

  useEffect(() => {
    axios.get("http://localhost:8080/getCompanies")
      .then(res => setCompanyList(res.data))
      .then(setloading(false))
  }, []);
  
  if(!loading){
  return(
<Fragment>
    <Jumbotron>
      <h1>Hello, world!</h1>
      <p>
        This is a simple hero unit, a simple jumbotron-style component for calling
        extra attention to featured content or information.
      </p>
      <p>
        <Button variant="primary">Learn more</Button>
      </p>
    </Jumbotron>
    <div>
      <Companies companyList={companyList} setCompanyList={setCompanyList.bind(this)} />
      <Car />
    </div>
    </Fragment>
  ) 
}
  else{
    return(
      <div>
        <h1>Loading companies...</h1>
      </div>
    )
  }
}
